  selectedFiles.value = []
  selectedImages.value = []
  const files = e.target?.files
  if (files.length == 0) {
    return
  }
  for (let i = 0; i < files.length; i++) {
    const reader = new FileReader();
    reader.onload = () => {
      selectedImages.value.push(reader.result)
    };

    reader.readAsDataURL(files[i]);
  }
  selectedFiles.value = files
  await uploadImages()
}

